import React from "react";
import { Card } from "../../Card.styled";

const Grid1 = ({ styles }) => {
  return (
    <Card bd={"1px solid red"} dp={"grid"} gridC={"50% 50%"}>
      <Card dp={"grid"} gridC={"70% 30%"} bd={"1px solid blue"}>
        <Card bd={"1px solid black"}>
          <Card cl={styles.colors.textAlt} fs={"1.5rem"}>
            Trending
          </Card>
          <Card fs={"2rem"}>
            <b>Auctions.</b>
          </Card>
          <Card fs={"0.8rem"}>Enjoy! the latest hot auctions.</Card>
        </Card>
      </Card>
    </Card>
  );
};

export default Grid1;
